import React from "react";


function Card(props){
    return(
  <>

    <div className='Carts'>
    <div className='card'>
    <img src={props.imgsrc}  alt="img" /> 
     <br></br>
       <a href='https://www.netflix.com/pk/' target='blank'>
       <button>Watch now</button>
       </a>
    </div>
   </div>
  </>)
  }

export default Card;
